import { React, useEffect, useState } from "react";
import axios from "axios";

const Kategorije = () => {
  const [data, setData] = useState({ lista: [] });

  useEffect(async () => {
    const result = await axios("http://localhost:5000/kategorije/");

    setData(result.data);
  }, []);
  console.log(data);
  return (
    <div>
      {[data].map((item) => (
        <h1>{item.naziv}</h1>
      ))}
    </div>
  );
};

export default Kategorije;
